const multimeter_blue = require('./../../assets/multimeter_blue.svg')
const multimeter_white = require('./../../assets/multimeter_white.svg')
const wires = require('./../../assets/wires.png')
const wallPoster = require('./../../assets/wall.png')
const brand1 = require('./../../assets/brand-1.png')
const brand2 = require('./../../assets/brand-2.png')
const brand3 = require('./../../assets/brand-3.png')
const brand4 = require('./../../assets/brand-4.png')
const rupeeBlack = require('./../../assets/rupee_black.svg')
const rupeeWhite = require('./../../assets/rupee_white.svg')
const shieldBlack = require('./../../assets/shield.svg')
const shieldWhite = require('./../../assets/shield_white.svg')
const avatarBlack = require('./../../assets/avatar.svg')
const sosWhite = require('./../../assets/sos-warning-white.svg')
const sosBlack = require('./../../assets/sos-warning.svg')
const clockWhite = require('./../../assets/clock-circular-outline-white.svg')
const clockBlack = require('./../../assets/clock-circular-outline.svg')
const phone = require('./../../assets/phont.png')
const testimonialImg = require('./../../assets/testimonialImg.png')



export default {
    multimeter_blue, 
    multimeter_white,
    wires,
    wallPoster,
    brand1,
    brand2,
    brand3,
    brand4,
    rupeeBlack,
    rupeeWhite,
    shieldBlack,
    shieldWhite,
    avatarBlack,
    sosWhite,
    sosBlack,
    clockWhite,
    clockBlack,
    phone,
    testimonialImg,
}
